INSERT INTO `products` (`PRODUCT_ID`, `PRODUCT_NAME`, `AUTHOR`, `CATEGORY`, `SUPPLIER`, `QUANTITY`, `PRICE`, `DESCRIPTION`, `IMAGE_URL`) VALUES
(1, 'Biên Niên Ký Chim Vặn Dây Cót', 'Haruki Murakami', 'Tiểu thuyết', 'Nhã Nam', 151, 170501, 'Câu chuyện đưa ta đến nước Nhật thời hiện đại, với những thân phận con người bé nhỏ, lạ lùng. Những cô bé 15 tuổi, như Kasahara May, ngồi sau xe môtô phóng với tốc độ kinh hoàng, vươn tay bịt mắt bạn trai phía trước. Sau tai nạn, bạn trai qua đời, chỉ còn lại mình cô với nỗi day dứt khôn nguôi: \"Chính vì có cái chết, người ta mới phải băn khoăn nhiều đến thế về sự sống.\" Những thiếu nữ, như Kano Kreta, tự kết liễu đời mình để giải thoát những cơn đau triền miên có thể gặp phải bất cứ lúc nào, vì bất cứ điều gì nhưng không thành. Phải trả nợ một khoản tiền lớn cho hãng bảo hiểm, không do dự, cô đi làm gái điếm. Những Dân biểu nghị viên như Wataya Noburu, leo cao trong danh vọng nhờ tài lừa dối đám đông và khả năng khơi dậy những bản năng sa đọa ở người khác... Trong thế giới ấy, nhân vật chính của Biên Niên Ký Chim Vặn Dây Cót, Okada Toru, chàng trai giản dị và chân thành, phải đối mặt với biến cố lạ lùng: Kumiko, người vợ yêu dấu của anh bỗng nhiên biến mất không một lời nhắn gửi. Sự kiện phi lý này khơi nguồn cho sự thức tỉnh trong Okada, thúc đẩy anh ngắm nhìn, chứng nghiệm lại thế giới tràn đầy cái phi lý chung quanh mình, bằng con mắt bản thể.', 'biennienkychimvandaycot.png'),
(2, 'Cây Cam Ngọt Của Tôi', 'José Mauro de Vasconcelos', 'Tiểu thuyết', 'Nhã Nam', 50, 71000, 'Hãy làm quen với Zezé, cậu bé tinh nghịch siêu hạng đồng thời cũng đáng yêu bậc nhất, với ước mơ lớn lên trở thành nhà thơ cổ thắt nơ bướm. Chẳng phải ai cũng công nhận khoản “đáng yêu” kia đâu nhé. Bởi vì, ở cái xóm ngoại ô nghèo ấy, nỗi khắc khổ bủa vây đã che mờ mắt người ta trước trái tim thiện lương cùng trí tưởng tượng tuyệt vời của cậu bé con năm tuổi.\r\nCó hề gì đâu bao nhiêu là hắt hủi, đánh mắng, vì Zezé đã có một người bạn đặc biệt để trút nỗi lòng: cây cam ngọt nơi vườn sau. Và cả một người bạn nữa, bằng xương bằng thịt, một ngày kia xuất hiện, cho cậu bé nhạy cảm khôn sớm biết thế nào là trìu mến, thế nào là nỗi đau, và mãi mãi thay đổi cuộc đời cậu.\r\nMở đầu bằng những thanh âm trong sáng và kết thúc lắng lại trong những nốt trầm hoài niệm, Cây cam ngọt của tôi khiến ta nhận ra vẻ đẹp thực sự của cuộc sống đến từ những điều giản dị như bông hoa trắng của cái cây sau nhà, và rằng cuộc đời thật khốn khổ nếu thiếu đi lòng yêu thương và niềm trắc ẩn. Cuốn sách kinh điển này bởi thế không ngừng khiến trái tim người đọc khắp thế giới thổn thức, kể từ khi ra mắt lần đầu năm 1968 tại Brazil.', 'caycamngotcuatoi.png'),
(3, 'Hãy Về Với Cha', 'Shin Kyung-sook', 'Tiểu thuyết', 'Nhã Nam', 25, 122000, 'Mất đi con gái, nữ nhà văn thu mình lại, đoạn tuyệt với mọi mối quan hệ, thậm chí với chính những người thân trong gia đình, hòng trốn tránh nỗi đau và dằn vặt quá lớn. Phải tới khi về lại quê hương để chăm sóc người cha già yếu một thân một mình, cô mới nhận ra tấm khiên mình dựng lên bấy lâu cũng chính là mũi giáo đâm vào lòng những người ruột thịt.\r\nVề quê, về với ngôi làng nhỏ vẫn nằm đó yên bình giữa dòng đô thị hóa thô bạo. Về với cha, về với những ký ức tuổi thơ vẫn trong lành vẹn nguyên. Và những mất mát tưởng chừng mãi mãi không thể lành cũng dần được hàn gắn.\r\n10 năm sau Hãy chăm sóc mẹ, Shin Kyung-Sook trở lại với Hãy về với cha, không chỉ đơn thuần là một tiểu thuyết tình cảm gia đình mà còn là một nỗ lực thấu hiểu những người thân không toàn vẹn, đồng thời cũng là một khúc ngân hoài niệm tuổi thơ trong trẻo đã mãi rời', 'hayvevoicha.png'),
(4, 'Người Đua Diều', 'Khaled Hosseini', 'Tiểu thuyết', 'Nhã Nam', 283, 119500, 'Câu chuyện là lời tự thuật của nhà văn người Mỹ gốc Afghanistan Amir về những năm tháng tuổi thơ đầy niềm vui cũng như lỗi lầm, về những ngày trôi dạt trên đất khách rồi cuộc hành trình trở lại quê hương đổ nát để cứu chuộc tội lỗi cho bản thân và cho cả người cha đã khuất. Theo dòng hồi ức của Amir, người đọc trở lại hơn hai mươi năm về trước, khi Amir còn là một cậu bé mười hai tuổi sống trong vòng tay che chở của Baba giàu sang và thanh thế. Cùng gắn bó với Amir suốt những năm tháng tuổi thơ là Hassan, con trai của người quản gia Ali, một cậu bé lanh lợi, mạnh mẽ nhiều lần xả thân để bảo vệ Amir. Thế nhưng tình bạn và lòng tận tụy của Hassan đã không được đền đáp, một ngày mùa đông năm 1975, Hassan vì ra sức bảo vệ chiếc diều xanh chiến lợi phẩm của Amir đã bị bọn trẻ xấu hành hung và nhục mạ. Sự nhu nhược và hèn nhát đã cản bước Amir cứu bạn, thậm chí, còn biến cậu thành một kẻ gian dối khi bịa chuyện nhằm đuổi cha con Ali và Hassan ra khỏi nhà. Và Amir đã phải trả giá cho lỗi lầm ấy trong suốt phần đời còn lại. Ngay cả khi anh đang sống sung túc trên đất Mỹ, ngay cả khi tìm được một mái ấm cho riêng mình hay thực hiện được mơ ước trở thành nhà văn, nỗi ám ảnh của một kẻ gian dối vẫn ngày đêm đeo đuổi Amir. Và cuối cùng, trở lại Afghanistan để cứu con trai Hassan khỏi tay bọn Taliban là con đường duy nhất để Amir chuộc lỗi với người bạn, người em cùng cha khác mẹ Hassan đã chết dưới họng súng Taliban.', 'nguoiduadieu.png'),
(5, 'Trường Ca Achilles', 'Madeline Miller', 'Tiểu thuyết', 'Wings Books', 56, 116000, 'Hy Lạp vào thời hoàng kim của các anh hùng. Patroclus là một hoàng tử trẻ vụng về, bị trục xuất tới vương quốc Phthia và được nuôi dạy dưới sự che chở của vua Peleus cùng cậu con trai hoàng kim của ngài, Achilles. “Người Hy Lạp vĩ đại nhất” – mạnh mẽ, đẹp đẽ, và mang nửa dòng máu của một nữ thần – Achilles là tất cả những gì mà Patroclus không bao giờ có được. Nhưng bất chấp sự khác biệt giữa họ, hai cậu bé trở thành chiến hữu trung thành của nhau. Tình cảm giữa họ càng đậm sâu khi cả hai lớn lên thành những chàng trai trẻ, thành thạo trong kĩ nghệ chiến đấu và y dược.\r\nKhi tin tức truyền tới rằng nàng Helen xứ Sparta đã bị bắt cóc, những chiến binh Hy Lạp, bị trói buộc bởi lời thề máu, phải nhân danh nàng mà vây hãm thành Troy. Bị cám dỗ bởi lời hứa hẹn về một số mệnh huy hoàng, Achilles tham gia hàng ngũ của họ. Bị giằng xé giữa tình yêu và nỗi lo sợ dành cho người bạn của mình, Patroclus ra trận theo Achilles. Họ không hay biết rằng các nữ thần Số Phận sẽ thử thách cả hai người họ hơn bao giờ hết và đòi hỏi một sự hi sinh khủng khiếp.\r\nDựa trên nền tảng của sử thi Iliad, câu chuyện về cuộc chiến thành Troy vĩ đại đã được Madeline Miller kể lại với tiết tấu dồn dập, lôi cuốn, và không kém phần xúc động, đánh dấu sự khởi đầu của một sự nghiệp rực rỡ. ', 'truongcaachilles.png'),
(6, 'Chiến Tranh Tiền Tệ - Phần 1', 'Song Hong Bing', 'Sách kinh tế', 'Bách Việt', 20, 97600, 'Phần lớn chúng ta thường nghĩ sự hiện diện của đồng tiền trong cuộc sống là một lẽ đương nhiên, như không khí hay nước vậy. Rất ít người trong chúng ta hiểu được nguồn gốc của tiền bạc cũng như sự sinh tồn và phát triển của đồng tiền.\r\nMột khi đọc “Chiến tranh tiền tệ - Ai thật sự là người giàu nhất thế giới” bạn sẽ phải giật mình nhận ra một điều kinh khủng rằng, đằng sau những tờ giấy bạc chúng ta chi tiêu hàng ngày là cả một thế lực ngầm đáng sợ - một thế lực bí ẩn với quyền lực siêu nhiên có thể điều khiển cả thế giới rộng lớn này.', 'chientranhtiente1.png'),
(7, 'Giải Phẫu Học Về Giãn Cơ', 'Arnold G. Nelson', 'Sách Y Học', ' Pandabooks', 55, 208000, 'Cuốn sách “Giải phẫu học về giãn cơ” cung cấp những hướng dẫn được minh họa sinh động, giúp bạn cải thiện sự linh hoạt và sức mạnh cơ bắp. Cuốn sách đã bán hơn 250.000 bản trên toàn thế giới. “Giải phẫu học về giãn cơ” giúp bạn hiểu tường tận từng bài tập giãn cơ, đồng thời tăng tính linh hoạt và cải thiện sức mạnh cơ bắp. Cuốn sách còn mở rộng, nâng cao hơn và cập nhật các thông tin mới sẽ chỉ dẫn cho bạn cách tăng cường phạm vi chuyển động, bổ sung các bài tập, tăng khả năng hồi phục và tối đa hóa hiệu quả của các động tác. Bạn cũng sẽ hiểu được chi tiết các ảnh hưởng từ mỗi bài tập giãn cơ đến cơ thể của mình.', 'giaiphauhocvegianco.png'),
(8, 'Học Cách Học', 'Nhiều tác giả', 'Sách Tham Khảo', ' Alphabooks', 10, 110000, 'Cách cho tâm trí lang thang để kích hoạt chế độ tập trung học tập;  Cách ra khỏi “tư duy lối mòn” để tư duy bứt phá;  Cách để biến một trí nhớ kém trở thành lợi thế tư duy;  Cách đơn giản nhưng đầy hiệu quả để đập tan sự trì hoãn, hãy dùng một quả cà chua (Pomodoro).  Đồng hành cùng khóa học nổi tiếng Học Cách Học, cuốn sách sẽ giúp bạn mở khóa não bộ, để việc học trở nên dễ dàng và thú vị.', 'hoccachhoc.png'),
(9, 'Thuật Thúc Đẩy Nhân Viên', 'Brian Tracy', 'Sách Tham Khảo', ' Alphabooks', 34, 71000, 'Với tư cách một nhà quản lý, một trong những trách nhiệm quan trọng nhất của bạn là khuyến khích nhân viên dưới quyền nỗ lực hết sức mình trong công việc. Các nhà quản lý biết cách tạo ra những môi trường tích cực, khuyến khích khen thưởng sẽ làm giảm tỉ lệ vắng mặt và thay đổi nhân sự đồng thời tăng đáng kể năng suất và chất lượng công việc. Với kinh nghiệm của bản thân, Brian Tracy sẽ cung cấp cho độc giả 21 bí kíp súc tích, mạnh mẽ và vô cùng hiệu quả để gia tăng hiệu suất của bất kì cá nhân hoặc nhóm làm việc nào', 'thuatthucdaynhanvien.png'),
(10, 'Lược Sử Thế Giới', 'E.H. Gombrich', 'Sách Lịch Sử', 'Nhã Nam', 67, 266500, 'Như một bài thơ về lịch sử thế giới, E. H. Gombrich lịch lãm dẫn người đọc đi từ thời kỳ Đồ đá đến thời kỳ của năng lượng nguyên tử, với những biến cố lịch sử phức tạp nhất, các trào lưu tư tưởng khó hiểu nhất, những nhân vật lịch sử đa chiều nhất, các thành tựu lớn lao nhất của trí tuệ con người… tất cả đều được tác giả mô tả và diễn giải dễ hiểu đến bất ngờ.  Với cuốn sách này trong tay, bạn sẽ thấy niềm vui to lớn trong việc tìm hiểu lịch sử, cùng vô số khoảnh khắc quên hết tất cả để say mê đắm mình trong quá vãng của dòng chảy lịch sử.', 'luocsuthegioi.png'),
(14, 'World History - Lịch Sử Thế Giới', 'Philip Parker', 'Sách Lịch Sử', 'Zenbooks', 87, 386500, 'Sách được chia thành 8 phần. Sau phần mở đầu khá ngắn gọn về vai trò của lịch sử, tác giả dành 7 phần còn lại cho tương ứng 7 giai đoạn trong dòng chảy tiến hoá: thời tiền sử; cổ đại; cổ đại cổ điển và hậu kỳ cổ đại; trung cổ; cận hiện đại; thế giới của các đế quốc; và cuối cùng là thế giới hiện đại.', 'lichsuthegioi.png'),
(15, 'Lý Thuyết Trò Chơi', 'Trần Phách Hàm', 'Sách Kỹ Năng Sống', '1980 Books', 12, 121720, 'Cuốn sách Lý thuyết trò chơi là bách khoa toàn thư về tâm lý học, về tẩy não và chống lại tẩy não, thao túng và chống lại thao túng, thống trị và chống lại thống trị. Cuốn sách giới thiệu công thức chiến thắng cho những “trò chơi” đấu trí giữa người với người trong cuộc sống hằng ngày; phân tách các khái niệm lý thuyết trò chơi vốn mơ hồ trở thành ngôn ngữ dễ hiểu và kết nối liền mạch với nghệ thuật tâm lý học; cho phép bạn nắm vững những bí ẩn của trò chơi tâm lý trong thời gian ngắn nhất.', 'lythuyettrochoi.png'),
(16, 'Thân Tâm Trí', 'Marion Solomon', 'Sách Kỹ Năng Sống', '1980 Books', 24, 113000, 'Thân thể – tâm thần – trí tuệ từ lâu đã được biết đến là ba thể riêng biệt nhưng không thể tách rời của mỗi người. Sự hợp nhất ba thể này tạo nên trạng thái cân bằng và phục hồi tự nhiên bên trong. Cơ chế hình thành điều đó là rèn luyện một cơ thể khỏe mạnh, nuôi dưỡng một tâm trí sáng suốt, tin tưởng rằng có sự hạnh phúc hiện hữu trong sâu thẳm, có sự tử tế ẩn sâu đợi được khơi dậy đằng sau tất cả những biến cố thăng trầm.', 'thantamtri.png'),
(21, 'Bạn Đắt Giá Bao Nhiêu?', 'Vãn Tình', 'Sách Kỹ Năng Sống', 'Bloom Books', 345, 87100, 'Hơn bốn mươi câu chuyện trong sách xoay quanh các chủ đề tình yêu, hôn nhân, gia đình, sự nghiệp… đến từ chính cuộc sống của tác giả và những người xung quanh, vừa thực tế lại vừa gợi mở, dễ dàng giúp chúng ta liên hệ với tình huống của chính mình. Với những câu chuyện đó, Vãn Tình hi vọng có thể giúp các cô gái thoát khỏi tình cảnh khó khăn, tìm lại bản ngã, sống cuộc đời theo cách mà mình mong muốn.', 'bandatgiabaonhieu.png'),
(24, 'Sách Người Giàu Có Nhất Thành Babylon', 'GEORGE SAMUEL CLASON', 'Sách kinh tế', ' First News - Trí Việt', 5000, 68100, 'Người giàu có nhất thành Babylon (tiếng Anh: The Richest Man in Babylon) được xem là một trong những tác phẩm truyền cảm hứng lớn nhất về chủ đề tiết kiệm, kế hoạch tài chính và sự giàu có cá nhân. Tác phẩm được viết bởi doanh nhân, nhà văn Mỹ George Samuel Clason vào năm 1926, kể về cách tiết kiệm, buôn bán và làm giàu của người dân ở thành Babylon cổ xưa.  Ban đầu đây chỉ là một tập sách nhỏ, viết về các cách quản lý tài chính và do các ngân hàng và công ty bảo hiểm phân phối. Sau khi được tổng hợp, biên tập thành một cuốn sách trọn vẹn, “Người giàu có nhất thành Babylon” bất ngờ trở nên phổ biến và nổi tiếng trên toàn thế giới bởi những lời khuyên về quản lý tài chính hết sức khôn ngoan.  Cuốn sách tập hợp nhiều câu chuyện cổ về các nhân vật vươn lên từ nghèo khổ để trở nên giàu có, được kính trọng bậc nhất thành Babylon. Có thể kể đến câu chuyện của “người giàu có nhất thành Babylon” Arkad – một thợ khắc gỗ khi còn trẻ, hay người cho vay vàng Mathon, những người nô lệ như Dabasir, Megiddo, Sharru Nada,…', 'nguoigiauconhatthanhbabylon.png'),
